	// set image width
	// fixex image height automatically
	function setWidth($width){
		$this->imageWidth = $width;
		
		// nepal's height is roughly 0.5 of width
		$this->imageHeight = $width * (900/1598);
	
	}
	
	// set stroke color and width
	function setStroke($rgbArray, $width){
		$this->strokeColor = $rgbArray;
		$this->strokeWidth = $width;
	}
	
	// return image width
	function getImageWidth(){
		return $this->imageWidth;
	}

	// return image height
	function getImageHeight(){
		return $this->imageHeight;
	}
	
	// set district fill color
	function setDistrictFillColor($fillColor){
		foreach ($fillColor as $district=>$color){
			$this->fillColor[strtolower($district)]=$color;
		}
	}
		
	// generate map
	// save to filename if given
	// else throw it in browser
	function generateMap($filename=''){
	
		if ($filename=='') header ("Content-type: image/png");
		
		// the original data is for map size of 1598x900
		// map to be drawn has to be scaled
		$scale = ($this->imageWidth - $this->strokeWidth + 1) / 1598.0;
		
		// start drawing map
		$im = @imagecreatetruecolor($this->imageWidth, $this->imageHeight);
		imagesavealpha($im, true);
		$trans_colour = imagecolorallocatealpha($im, 0, 0, 0, 127);
		imagefill($im, 0, 0, $trans_colour);
		
		imagesetthickness($im, $this->strokeWidth);
		
		$strokeColor = imagecolorallocate($im, $this->strokeColor[0], $this->strokeColor[1], $this->strokeColor[2]);
		
		// process all district polygons
		foreach ($this->districts as $d=>$c){
			$minx = $maxx = $c[0] * $scale;
			$miny = $maxy = $c[1] * $scale;
			
			for ($i=2;$i<count($c);$i+=2){
				
				// scale the points to given width x height
				$x1 = $c[$i-2] * $scale;
				$y1 = $c[$i-1] * $scale;
				$x2 = $c[$i+0] * $scale;
				$y2 = $c[$i+1] * $scale;

				// draw district border line
				imageline($im, $x1, $y1, $x2, $y2, $strokeColor);
				//imagesetpixel($im, $x1,$y1,$strokeColor);
				
				// find min n max points
				if ($x1 < $minx) $minx = $x1;
				if ($y1 < $miny) $miny = $y1;
				if ($x1 > $maxx) $maxx = $x1;
				if ($y1 > $maxy) $maxy = $y1;
			}
			
			// find center of district polygon
			$cx = $minx + ($maxx-$minx)/2;
			$cy = $miny + ($maxy-$miny)/2;
			
			// fill the district polygon
			if (isset($this->fillColor[$d])){
				$fillColor = imagecolorallocate($im, $this->fillColor[$d][0], $this->fillColor[$d][1], $this->fillColor[$d][2]);
				imagefill($im, $cx, $cy, $fillColor);
				
				// SPECIAL CASE
				// Achham has a narrow area in the bottom right
				// which can remain unfilled in smaller map sizes
				if ($d=='achham'){
					imagefill($im, 292*$scale, 375*$scale, $fillColor);
					imagefill($im, 280*$scale, 353*$scale, $fillColor);
				}
			}
			
		}		
		
		if ($filename=='') imagepng($im);
		else imagepng($im, $filename);
		
	}
	
	// return <area> tags for <map>
	function htmlAreaCode(){
		$html = "";
		$scale = ($this->imageWidth - $this->strokeWidth + 1) / 1598.0;

		// process all district polygons
		foreach ($this->districts as $d=>$c){
			
			$scaled = array();
			foreach ($c as $cor) $scaled[] = round($cor*$scale);
			
			$html .= "<area href=\"#$d\" title=\"".ucwords($d)."\" shape=\"poly\" coords=\"";
			$html .= implode(",",$scaled);
			$html .= "\"></area>\n";
		}
		
		return $html;		
	}
	
